webpackJsonp([0x9ec2bc9d7956],{514:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Hello, React",author:"Monica Powell"}},markdownRemark:{id:"/Users/monica/Dev/hello-react/src/pages/humble-bundle/index.md absPath of file >>> MarkdownRemark",html:'<p>Humble Bundle is a website that allows you to pay what you want for digital copies of books and games. A portion of every order is donated to charity.</p>\n<p>Last week, I purchased my first Humble Bundle when I decided to purchase $625 worth of O‚ÄôReilly media web design and development books for $15!</p>\n<p>Pro-tip: You can decide how much of your purchase is donated and how much is directed to Humble Bundle versus the publisher.</p>\n<ul>\n  <li>Programming Voice Interfaces</li>\n  <li>Mobile App Development with Ionic</li>\n  <li>JSON at Work</li>\n  <li>Refactoring JavaScript</li>\n  <li>CSS Refactoring</li>\n  <li>Interactive Data Visualization for the Web</li>\n  <li>Learning React Native</li>\n  <li>Learning HTTP/2</li>\n  <li>SVG Animations</li>\n  <li>Working with Static Sites</li>\n  <li>React Native Cookbook</li>\n  <li>CSS: The Definitive Guide</li>\n  <li>Using SVG with CSS3 and HTML5</li>\n  <li>Learning React</li>\n  <li>High Performance Images</li>\n</ul>\n<p>Oh, and here‚Äôs a great quote from this Wikipedia ondd\n<a href="http://en.wikipedia.org/wiki/Salted_duck_degg">salted duck eggs</a>.</p>\n<blockquote>\n<p>A salted duck egg is a Chinese preserved food product made by soaking duck\neggs in brine, or packing each egg in damp, salted charcoal. In Asian\nsupermarkets, these eggs are sometimes sold covered in a thick layer of salted\ncharcoal paste. The eggs may also be sold with the salted paste removed,\nwrapped in plastic, and vacuum packed. From the salt curing process, the\nsalted duck eggs have a briny aroma, a gelatin-like egg white and a\nfirm-textured, round yolk that is bright orange-red in color.</p>\n</blockquote>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-3f5a1.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Chinese Salty Egg"\n        title=""\n        src="/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-f8fb9.jpg"\n        srcset="/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-e8976.jpg 148w,\n/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-63df2.jpg 295w,\n/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-f8fb9.jpg 590w,\n/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-85e3d.jpg 885w,\n/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-d1924.jpg 1180w,\n/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-9452e.jpg 1770w,\n/hello-react/static/salty_egg-8058f3f26913fea3b6a89a73344fe94a-3f5a1.jpg 2048w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<blockquote class="twitter-tweet" data-lang="en"><p lang="en" dir="ltr">I purchased my first humble bundle! $15 for $625 worth of <a href="https://twitter.com/OReillyMedia?ref_src=twsrc%5Etfw">@OReillyMedia</a> web design and development books.<br><br>Pro-tip: You can decide how much of your purchase is donated to <a href="https://twitter.com/codeforamerica?ref_src=twsrc%5Etfw">@codeforamerica</a> ;)  <a href="https://t.co/0VaiHmnr8Q">https://t.co/0VaiHmnr8Q</a> via <a href="https://twitter.com/humblebooks?ref_src=twsrc%5Etfw">@humblebooks</a> <a href="https://twitter.com/hashtag/100daysofcode?src=hash&amp;ref_src=twsrc%5Etfw">#100daysofcode</a> <a href="https://twitter.com/hashtag/codenewbie?src=hash&amp;ref_src=twsrc%5Etfw">#codenewbie</a></p>&mdash; Monica üë©üèæ‚Äçüíª (@waterproofheart) <a href="https://twitter.com/waterproofheart/status/1000524009040220160?ref_src=twsrc%5Etfw">May 26, 2018</a></blockquote>\n<script async src="https://platform.twitter.com/widgets.js" charset="utf-8"></script>',frontmatter:{title:"Humble Bundle! Books Galore!",date:"June 07, 2018"}}},pathContext:{slug:"/humble-bundle/",previous:{fields:{slug:"/my-second-post/"},frontmatter:{title:"My Second Post!"}},next:null}}}});
